import React  from 'react'
// import axios from "axios"
import { useSearchParams } from 'react-router-dom'
import { Route, Navigate } from 'react-router-dom';
import SignIn from './SignIn';

export default function Login (){


    const [searchParams] = useSearchParams();
        console.log(searchParams.get("login"))

    var data={
        "login": searchParams.get("login"),
        "password": searchParams.get("password"),
        "role": "user"
        }

      
        // const res = await axios.get('https://fortnite-api.com/v2/cosmetics/br/');
        // const items = res.data.data.slice(200,300);

        if ( data.login === "mashateayoub@gmail.com" && data.password === "ayoub1999"  ){
            localStorage.setItem("userID", data.login+"@"+data.password)
        }
        else {
            localStorage.setItem("loggingerror", "yes")
        }

    return (
        
        <div className='flex my-40 flex-col rid place-items-center h-screen'>
            <Route >
            {!localStorage.getItem("userID").localeCompare(" ")? <Navigate to="/" replace= {true} /> : <Navigate to="/signin" replace= {true} />}
            </Route>
          <p className='align-middle text-xl font-semibold font-serif '>Logged In successfully , redirected to the app .... </p> 
          <img src='https://www.svgrepo.com/show/314685/spinner-solid.svg' alt=' '  className='animate-spin mt-8 w-12 align-middle '/>      
        </div>
    )
}
